import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faStar } from '@fortawesome/free-regular-svg-icons';
import './App.css';
import MySlider from './Components/Slider/Slider';
import Navtabs from './Components/Navtabs/Navtabs';
import Rating from './Components/Rating/Rating';
import MyTeam from './Components/Team/Team';
import RegForm from './Components/RegForm/RegForm';
import LoginForm from './Components/LoginForm/LoginForm';
import Footer from './Components/Footer/Footer';

const farStar = <FontAwesomeIcon icon={faStar} />


function Home() {
  return (
    <div>
      <MySlider />
      <Footer />
    </div>
  );
}

function Pricing() {
  return (
    <div>
      <Footer />
  </div>
  );
}

function Feedback() {
  return (
    <div>
      <Navtabs />
      <Rating />
      <Footer />
    </div>
  );
}

function Team() {
  return (
    <div>
      <MyTeam />
      <Footer />
    </div>
  );
}

function Signin() {
  return (
    <div>
      <LoginForm />
      <Footer />
    </div>
  );
}
function Signup() {
  return (
    <div>
      <RegForm />
      <Footer />
    </div>
  );
}

export default function App() {
  return (
    <>
    <Router>
      <div>
        <header className="navBg">
          <div className="content-wrapper">
            <Navbar collapseOnSelect expand="sm" variant="light">    
              <Navbar.Brand href="/start-it-front" className="navLogo">
                {farStar} Star It
              </Navbar.Brand>
              <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                  <Nav className="mr-auto">
                    <Nav.Link href="/start-it-front/pricing">Pricing</Nav.Link>
                    <Nav.Link href="/start-it-front/team">Team</Nav.Link>
                    <Nav.Link href="/start-it-front/feedback">Feedback</Nav.Link>
                  </Nav>
                  <Nav>
                    <Nav.Link href="/start-it-front/login">Sign in</Nav.Link>
                    <Nav.Link href="/start-it-front/join" className="navJoin">Sign up</Nav.Link>
                  </Nav>
                </Navbar.Collapse>
              </Navbar>
            </div>    
        </header>

        <Switch>

          <Route path="/start-it-front/join" component={Signup}/>           
          <Route path="/start-it-front/login" component={Signin}/>            
          <Route path="/start-it-front/feedback" component={Feedback}/>            
          <Route path="/start-it-front/team">
            <Team />
          </Route>
          <Route path="/start-it-front/pricing">
            <Pricing />
          </Route>
          <Route exact path="/start-it-front">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
    </>
  );
}
